import React from "react";
import Footer from "../component/Footer";
import WebNav from "../component/WebNav";
import RegisterForm from "../component/RegisterForm";
import { setState } from 'react';

const Register = () => {

    return (
        <>
            <WebNav />
            <RegisterForm />
            <Footer />
        </>
    )
};

export default Register;
